summary:
Jean-Baptiste Lemoyne peut désigner :Jean-Baptiste Lemoyne (1679-1731), dit Jean-Baptiste I Lemoyne, un sculpteur français ;
Jean-Baptiste Le Moyne de Bienville (1680-1767), un explorateur français, fondateur de La Nouvelle-Orléans ;
Jean-Baptiste Lemoyne (1704-1778), dit Jean-Baptiste II Lemoyne, un sculpteur français, neveu du sculpteur Jean-Baptiste I Lemoyne ;
Jean-Baptiste Moyne, dit Lemoyne (1751-1796), un compositeur français ;
Jean-Baptiste Lemoyne (1977-), un homme politique français.

Paul Christophe est un nom de personne assez fréquent en Belgique et dans le nord de la France ; il peut désigner notamment :Paul Christophe (1870-1957), ingénieur belge ;
le père Paul Christophe (1932-2016), professeur honoraire à l'Université catholique de Lille ;
Paul Christophe, homme politique français.

Cailleau est un nom de famille notamment porté par :
André-Charles Cailleau (1731-1798), libraire et éditeur français ;
Clément Cailleau (en) (1923-2011), évêque français, préfet apostolique au Sénégal ;
Guillaume Cailleau (en), artiste et réalisateur français ;
Hubert Cailleau (~1526-~1579), enlumineur à Valenciennes ;
Marie Antoinette Cailleau, veuve Duchesne, libraire et éditrice française.
